import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import Navbar from './components/Navbar.js';

class App extends Component {
    render() {
        return (
            <div>
                <Navbar />
                Welcome to Milo!
            </div>
        );
    }
}

export default App;
